"253028":{"id":"253028","name":"Casamento às Cegas: México","slug":"casamento-as-cegas-mexico","original_title":"Love is Blind: México","overview":"Estes solteiros topam ficar noivos... sem nunca terem se visto cara a cara. O reality indicado ao Emmy® que busca descobrir se o amor é mesmo cego chega ao México.","first_air_date":"2024-08-01","episode_run_time":0,"vote_average":5.3,"number_of_seasons":1,"number_of_episodes":11,"created_by":[],"production_companies":["Fremantle Mexico"],"genres":["Reality"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/m552xrtdd95704AyFGvjQxhX3FR.jpg","poster_path":"https://image.tmdb.org/t/p/original/zBb0ZbSOHI37SSDdydzqVTwXd2J.jpg","cast":["Omar Chaparro","Lucy Chaparro","Luis Fer Campos","Gerardo Zapiain","Iraís Ramírez"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/ePzLCNe9YNCklgaQ1DzJWGjUfZ8.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/ePzLCNe9YNCklgaQ1DzJWGjUfZ8.jpg","air_date":"2024-08-01","episode_count":11,"overview":"Primeiro, vem o sim. Depois, eles se conhecem. Neste experimento social, casais decidem se casar com base exclusivamente em suas personalidades.","vote_average":0,"episodes":{"1":{"name":"Começa o experimento","overview":"Os solteiros chegam aos lounges e brindam ao amor com os apresentadores Lucy e Omar Chaparro. Depois, é hora de ir para as cabines e, quem sabe, encontrar uma alma gêmea.","air_date":"2024-08-01","runtime":62,"still_path":"https://image.tmdb.org/t/p/original/xKwYHtxQJLIoxG1gXqQxT8zrzJP.jpg","vote_average":0},"2":{"name":"Amor e traição?","overview":"Os solteiros vão se abrindo e criando conexões mais profundas. Alguns sonhos vão por água abaixo e outros viram realidade. O primeiro casal decide engatar um compromisso.","air_date":"2024-08-01","runtime":63,"still_path":"https://image.tmdb.org/t/p/original/slOiQmKOrrdrT3x33BpFsrWV88n.jpg","vote_average":0},"3":{"name":"A primeira noite juntos","overview":"Chema precisa decidir quem vai escolher, e Francesca encontra alguém que parece ainda melhor que o príncipe encantado. Próxima parada dos casais: Tulum.","air_date":"2024-08-01","runtime":57,"still_path":"https://image.tmdb.org/t/p/original/cXCZsyejVoufYSlU7IzSlWHY2Sp.jpg","vote_average":0},"4":{"name":"Nem tudo são flores","overview":"O romance começa a florescer no paraíso, mas não para todos. Conversas sobre famílias mistas, questões não negociáveis e outros tópicos polêmicos vêm à tona.","air_date":"2024-08-01","runtime":54,"still_path":"https://image.tmdb.org/t/p/original/5g9bg1diPtBGhAOcdt8cAkoDMrF.jpg","vote_average":0},"5":{"name":"Morando juntos","overview":"Os pombinhos se preparam para morar juntos na Cidade do México, só que alguns estão receosos com o que pode vir à tona. Um casal se reencontra e outro termina de vez.","air_date":"2024-08-08","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/1oFBAekxQ8oJRG9Ihlu8h4loqpd.jpg","vote_average":0},"6":{"name":"Uma volta explosiva","overview":"Um churrasco com a turma toda acaba em confusão. Dois homens conhecem a família das noivas. A vida real apresenta desafios bem concretos para um dos casais.","air_date":"2024-08-08","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/rHDERL6TTrj0vd5XL0eV4WaE8aC.jpg","vote_average":0},"7":{"name":"Família ou amor?","overview":"Fernando vive um momento decisivo. Willy luta contra o medo de compromisso. Uma reunião se transforma em briga quando os parentes colocam em dúvida a conexão de um casal.","air_date":"2024-08-08","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/a4laZFyQ0FXUeNkatfO3QPCfJnj.jpg","vote_average":0},"8":{"name":"Dúvidas","overview":"Uma festa de aniversário coloca Chema e Gerardo na berlinda. Karen decide acertar as contas com o passado. Chegou a hora de escolher os ternos e os vestidos.","air_date":"2024-08-08","runtime":60,"still_path":"https://image.tmdb.org/t/p/original/3YM4ViCA0ouKLesPca5H39yqc2f.jpg","vote_average":0},"9":{"name":"Despedidas","overview":"As despedidas de solteiro geram consequências amargas. O primeiro casal sobe ao altar. Será que o \"sim\" vem?","air_date":"2024-08-15","runtime":59,"still_path":"https://image.tmdb.org/t/p/original/34dh1QVIoU35Q0B8r2lgMO9qOye.jpg","vote_average":0},"10":{"name":"O amor é mesmo cego?","overview":"Rodeados de amigos e parentes, o restante dos casais sobe ao altar. Será que eles vão dar o grande passo ou deixar o parceiro na mão?","air_date":"2024-08-15","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/olHkYqXJrBnkLPLoazpKq9spBPR.jpg","vote_average":0},"11":{"name":"Reencontro","overview":"Chegou a hora de descobrir quais relações ainda estão pegando fogo e quais já se apagaram de vez. É obvio que vai ter reconciliações emocionantes e muito bafafá.","air_date":"2024-08-18","runtime":75,"still_path":"https://image.tmdb.org/t/p/original/7eo1rbeqXCoTWDa25227wMmPgNR.jpg","vote_average":0}}}}},
